import React from "react";

function MyApp()
{
  return(
  <div>
  <h2>Hi</h2>
  <p>How are you</p>
  <ul>
    <li>1</li>
    <li>2</li>
    <li>3</li>
  </ul>
  </div>
   )
}
export default MyApp;
